//원래 안써도 되지만
import React from 'react';
import Head from 'next/head';
import AppLayout from '../components/AppLayout';
import { Input, Form, Checkbox, Button } from 'antd';



// 훅스 문법 사용
const Signup = () => {
    const onSubmit = () => {

    };
    const onChangeId = () => {

    };
    const onChangeNick = () => {

    };
    const onChangePassword = () => {

    };
    const onChangePasswordChk = () => {

    };
    const onChangeTerm = () => {

    };

	return (
        <>
            <Head>
                <title>노드버드</title>
                <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/antd/3.18.2/antd.css" />
                <script src="https://cdnjs.cloudflare.com/ajax/libs/antd/3.18.2/antd.js" />
            </Head>
            <AppLayout>
                <Form onSubmit={onSubmit} style={{ padding:10}}>
                    <div>
                        <label htmlFor="user-id">아이디</label>
                        <br />
                        <Input name="user-id" required onChange={onChangeId} />
                    </div>
                    <div>
                        <label htmlFor="user-nick">닉네임</label>
                        <br />
                        <Input name="user-nick" required onChange={onChangeNick} />
                    </div>
                    <div>
                        <label htmlFor="user-pass">비밀번호</label>
                        <br />
                        <Input name="user-pass" type="password" required onChange={onChangePassword} />
                    </div>
                    <div>
                        <label htmlFor="user-pass-chk">비밀번호체크</label>
                        <br />
                        <Input name="user-pass-chk" type="password" required onChange={onChangePasswordChk} />
                    </div>
                    <div>
                        <Checkbox name="user-term" value="{term}" onChange={onChangeTerm}>약관동의</Checkbox>
                    </div>
                    <div>
                        <Button type="primary" htmlType="submit">가입하기</Button>
                    </div>
                </Form>
                <div>사인업</div>
            </AppLayout>
        </>
	);
};

export default Signup;
